import React from "react";

export default function Footer(title, content) {
    return (
    <div className='footer'>
        <div className='footer__title-block'>
            <button className='footer__left-button' />
            <h4 className='footer__title'>{title}</h4>
            <button className='footer__right-button' />
        </div>
        <div className='footer__content'>
            {content}
        </div>    
    </div>
    );
}
